@register("helloworld", "YourName", " Hello World ", "1.0.0")



class MyPlugin(Star):
    def text():
        
        pass
    def __init__(self, context: Context):
        super().__init__(context)
        current_dir = Path(__file__).parent
        self.data_dir = current_dir / "data"
        self.data_dir.mkdir(exist_ok=True)
        self.data_file = self.data_dir / "signin_data.json"
        self._ensure_data_file()

    def _ensure_data_file(self):
        if not self.data_file.exists():
            with open(self.data_file, 'w', encoding='utf-8') as f:
                json.dump({}, f)

    def _load_data(self):
        try:
            if not self.data_file.exists():
                return {}
            with open(self.data_file, 'r', encoding='utf-8') as f:
                return json.load(f)
        except:
            return {}

    def _save_data(self, data):
        try:
            with open(self.data_file, 'w', encoding='utf-8') as f:
                json.dump(data, f, ensure_ascii=False, indent=2)
        except:
            pass

    def _get_context_id(self, event):
        """ID"""
        try:
            if hasattr(event, 'message_obj') and hasattr(event.message_obj, 'group_id'):
                group_id = event.message_obj.group_id
                if group_id:
                    return f"group_{group_id}"

            if hasattr(event, 'group_id') and event.group_id:
                return f"group_{event.group_id}"

            user_id = event.get_sender_id()
            if user_id:
                return f"private_{user_id}"

            return "default_ctx"
        except:
            return "default_ctx"

    def _is_signed_in_today(self, ctx_id, user_id):
        """"""
        data = self._load_data()
        today = datetime.now().strftime("%Y-%m-%d")
        ctx_data = data.get(ctx_id, {})
        user_data = ctx_data.get(user_id, {})
        return user_data.get("last_checkin") == today

    def _record_signin(self, ctx_id, user_id, user_name):
        """"""
        data = self._load_data()
        today = datetime.now().strftime("%Y-%m-%d")

        if ctx_id not in data:
            data[ctx_id] = {}

        if user_id not in data[ctx_id]:
            data[ctx_id][user_id] = {
                "username": user_name,
                "last_checkin": None
            }

        data[ctx_id][user_id]["username"] = user_name
        data[ctx_id][user_id]["last_checkin"] = today

        self._save_data(data)

    @filter.event_message_type(filter.EventMessageType.GROUP_MESSAGE | filter.EventMessageType.PRIVATE_MESSAGE)
    async def listen_signin(self, event: AstrMessageEvent):
        """''"""
        # 
        message_text = event.message_str.strip()

        # ""
        if message_text != "":
            return

        # 
        user_id = event.get_sender_id()
        user_name = event.get_sender_name()
        ctx_id = self._get_context_id(event)

        if not user_id or not user_name:
            return

        if self._is_signed_in_today(ctx_id, user_id):
            yield event.plain_result("..")
            return

        options = {
            "quality": 40,
            "device_scale_factor_level": "ultra",
            "full_page": True,
            "omit_background": False,
            "type": "jpeg"
        }

        url = await self.html_render(TMPL, {
            "name": user_name,
            "b64ok": base64ok,
            "b64yi": base64yi,
            "b64ji": base64ji,
            "b64bg": base64bg
        }, options=options)

        self._record_signin(ctx_id, user_id, user_name)
        yield event.image_result(url)

    async def terminate(self):
        pass
